import React, { useEffect, useState } from 'react';
import { getAllStudents , createStudent} from '../services/studentService';
import '../css/sidebar.css';
import '../css/student.css';

const StudentList = () => {
  const [students, setStudents] = useState([]);
  const [error, setError] = useState('');
  const [formData, setFormData] = useState({
    name: '',
    rollnumber: '',
    password: '',
    permission: '',
    email: '',
    address: '',
    colgid: '',
  });

  const [search, setSearch] = useState('');
  const [filteredStudents, setFilteredStudents] = useState([]);

  useEffect(() => {
    fetchStudents();
  }, []);

  const fetchStudents = () => {
    getAllStudents()
      .then(response => {
        setStudents(response.data);
      })
      .catch(err => {
        setError('Failed to fetch students');
        console.error(err);
      });
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSearchChange = (e) => {
    setSearch(e.target.value);
  };

  const handleSearchSubmit = (e) => {
    e.preventDefault();
    const results = students.filter(student =>
      student.email.toLowerCase().includes(search.toLowerCase())
    );
    setFilteredStudents(results);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    createStudent(formData)
      .then(() => {
        setFormData({ name: '', email: '', password: '', permission: '', rollnumber: '', address: '', colgid: '' });
        fetchStudents();
      })
      .catch(err => {
        setError('Failed to add student');
        console.error(err);
      });
  };

  return (
    <div className="box">
      <h1>Students Data</h1>
      {error && <p style={{ color: 'red' }}>{error}</p>}

      {/* Add Admin Form */}
      <form onSubmit={handleSubmit} className="admin-form">
        <input type="text" name="name" placeholder="Name" value={formData.name} onChange={handleChange} required />
        <input type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} required />
        <input type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange} required />
        <input type="text" name="permission" placeholder="Permission" value={formData.permission} onChange={handleChange} required />
        <button type="submit">Add Admin</button>
      </form>

      {/* Search Form */}
      <form onSubmit={handleSearchSubmit} className="admin-form">
        <input type="text" placeholder="Search by email" value={search} onChange={handleSearchChange} />
        <button type="submit">Search Admin</button>
      </form>


      <table className="student-table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Roll Number</th>
            <th>Email</th>
            <th>Address</th>
            <th>College ID</th>
            <th>College Name</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {students.map(student => (
            <tr key={student.id}>
              <td>{student.name}</td>
              <td>{student.rollnumber}</td>
              <td>{student.email}</td>
              <td>{student.address}</td>
              <td>{student.colgid}</td>
              <td>{student.college.colgname}</td>
              <td>
                <button>Edit</button>
                <button>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default StudentList;
